import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useCart } from '../context/CartContext';

// Updated food items with new images downloaded from Google
const foodItems = [
  { id: 1, name: 'Coke', category: 'Cold Drink', image: '/images/coke.jpg', rating: 4.0, price: 2 },
  { id: 2, name: 'Pepsi', category: 'Cold Drink', image: '/images/pepsi.jpg', rating: 4.1, price: 2 },
  { id: 3, name: 'Sprite', category: 'Cold Drink', image: '/images/sprite.jpg', rating: 4.2, price: 2 },
  { id: 4, name: 'Fanta', category: 'Cold Drink', image: '/images/fanta.jpg', rating: 4.0, price: 2 },
  { id: 5, name: 'Mountain Dew', category: 'Cold Drink', image: '/images/mountaindew.jpg', rating: 4.3, price: 3 },
  { id: 6, name: 'Vanilla Ice Cream', category: 'Ice Cream', image: '/images/vanilla-icecream.jpg', rating: 4.5, price: 3 },
  { id: 7, name: 'Chocolate Ice Cream', category: 'Ice Cream', image: '/images/chocolate-icecream.jpg', rating: 4.6, price: 3 },
  { id: 8, name: 'Strawberry Ice Cream', category: 'Ice Cream', image: '/images/strawberry-icecream.jpg', rating: 4.4, price: 3 },
  { id: 9, name: 'Mint Ice Cream', category: 'Ice Cream', image: '/images/mint-icecream.jpg', rating: 4.3, price: 3 },
  { id: 10, name: 'Mango Ice Cream', category: 'Ice Cream', image: '/images/mango-icecream.jpg', rating: 4.7, price: 4 },
  { id: 11, name: 'Classic Burger', category: 'Burger', image: '/images/classic-burger.jpg', rating: 4.2, price: 5 },
  { id: 12, name: 'Cheese Burger', category: 'Burger', image: '/images/cheese-burger.jpg', rating: 4.3, price: 6 },
  { id: 13, name: 'Bacon Burger', category: 'Burger', image: '/images/bacon-burger.jpg', rating: 4.4, price: 7 },
  { id: 14, name: 'Double Patty Burger', category: 'Burger', image: '/images/double-patty-burger.jpg', rating: 4.5, price: 8 },
  { id: 15, name: 'Veggie Burger', category: 'Burger', image: '/images/veggie-burger.jpg', rating: 4.1, price: 5 },
  { id: 16, name: 'Margherita Pizza', category: 'Pizza', image: '/images/margherita-pizza.jpg', rating: 4.5, price: 8 },
  { id: 17, name: 'Pepperoni Pizza', category: 'Pizza', image: '/images/pepperoni-pizza.jpg', rating: 4.6, price: 10 },
  { id: 18, name: 'BBQ Chicken Pizza', category: 'Pizza', image: '/images/bbq-chicken-pizza.jpg', rating: 4.7, price: 12 },
  { id: 19, name: 'Veggie Pizza', category: 'Pizza', image: '/images/veggie-pizza.jpg', rating: 4.4, price: 9 },
  { id: 20, name: 'Hawaiian Pizza', category: 'Pizza', image: '/images/hawaiian-pizza.jpg', rating: 4.3, price: 11 },
  { id: 21, name: 'Gulab Jamun', category: 'Sweet', image: '/images/gulab-jamun.jpg', rating: 4.8, price: 4 },
  { id: 22, name: 'Rasgulla', category: 'Sweet', image: '/images/rasgulla.jpg', rating: 4.7, price: 4 },
  { id: 23, name: 'Jalebi', category: 'Sweet', image: '/images/jalebi.jpg', rating: 4.6, price: 3 },
  { id: 24, name: 'Kheer', category: 'Sweet', image: '/images/kheer.jpg', rating: 4.5, price: 5 },
  { id: 25, name: 'Barfi', category: 'Sweet', image: '/images/barfi.jpg', rating: 4.7, price: 4 },
  // Add more items up to 50+ with appropriate images and categories
];

const RestaurantList = ({ selectedCategory, searchTerm }) => {
  const { addToCart } = useCart();
  const [message, setMessage] = useState('');

  const filteredItems = selectedCategory
    ? foodItems.filter((item) => item.category.toLowerCase() === selectedCategory.toLowerCase())
    : foodItems;

  const searchedItems = searchTerm
    ? filteredItems.filter((item) => item.name.toLowerCase().includes(searchTerm.toLowerCase()))
    : filteredItems;

  const handleAddToCart = (item) => {
    addToCart({ ...item, quantity: 1 });
    setMessage(item.name + ' added to cart!');
    setTimeout(() => setMessage(''), 3000);
  };

  return (
    <>
      {message && (
        <div style={{ position: 'fixed', top: '10px', right: '10px', backgroundColor: '#d32f2f', color: 'white', padding: '10px 20px', borderRadius: '8px', zIndex: 1000 }}>
          {message}
        </div>
      )}
      <div className="food-list" style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(180px, 1fr))', gap: '20px' }}>
        {searchedItems.map((item) => (
          <div key={item.id} className="food-item-card" style={{ border: '1px solid #ddd', borderRadius: '8px', padding: '10px', backgroundColor: 'white' }}>
            <Link to={`/food/${item.id}`} style={{ textDecoration: 'none', color: 'inherit' }}>
              <img src={item.image} alt={item.name} style={{ width: '100%', borderRadius: '8px' }} />
              <h3>{item.name}</h3>
              <div style={{ display: 'flex', justifyContent: 'space-between', fontSize: '14px', color: '#555' }}>
                <span>⭐ {item.rating}</span>
                <span>${item.price.toFixed(2)}</span>
              </div>
            </Link>
            <button
              onClick={() => handleAddToCart(item)}
              style={{
                marginTop: '10px',
                backgroundColor: '#d32f2f',
                color: 'white',
                padding: '8px 12px',
                border: 'none',
                borderRadius: '6px',
                cursor: 'pointer',
                width: '100%',
              }}
            >
              Add to Cart
            </button>
          </div>
        ))}
      </div>
    </>
  );
};

export default RestaurantList;
